description:
Amazing what you can find just lying around on the web isn't it?

The former Newstar Cherry is 18, and has a shiny new site - newcherry.net.

She's topless too...oh my!

Thanks to fault3 for the heads-up these even existed.  Hope I'm not stepping on your toes by uploading these.

Enjoy!

